import styled from 'styled-components';

export const Container = styled.div`
    width: 80%;
    margin: auto;

    .menu-ul{
        list-style-type: none;
        text-align: center;
        display: inline;
        
        .menu-a{
            text-decoration: none;
        }
    }

    .section-product {
        height: 100vh;
        width: 100%;
        background: #e2e2;
        display: flex;
        flex-wrap: wrap;
        justify-content: center;

        .product-content{
            display: grid;
            text-align: center;
            height: 300px;
            background: #fff;
            border-radius: 12px;
            padding: 12px;
            margin: 10px;
        }
    }

    footer {
        min-height: 50px;
        background-color: #314584;
        padding: 10px;
        color: #fff;
    }
    
    footer h5 {
        text-align: center;
        font-size: 25px;
    }
    
    footer h1 {
        color: #ff3946;
        text-align: center;
        font-weight: bold;
        padding-top: 3px;
    }

`
